import React, { Component } from 'react'
import { connect } from 'react-redux'
import logo from '../utils/WUR.jpeg'

class Login extends Component {

    render() { 
      const { users } = this.props
      console.log(users)
      return (
        <div class="container">        	
     		<div class="col-md-12">
        		<div class="row">
        			<h4><strong>Welcome To Would You Rather App!</strong></h4>
        			<div>Please sign in to continue</div>
        		</div>
        		<div class="row">
        			<img src={logo} class="img-thumbnail" alt="Would You Rather"/>
        		</div>
  				<div class="row" style={{marginTop:'20px',color:'darkGreen'}}>
        			<h4><strong>Sign In</strong></h4>
        		</div>
				<select class="form-select" aria-label="Default select example">
                 <option value="" disabled selected>Please select</option>
                  <option value="A">A</option>
                  <option value="B">B</option>
                  <option value="C">C</option>  
              </select>
  			</div>     
        </div>    
      )
    }
  }

function mapStateToProps({users}) {

  let userArray = []

  Object.keys(users).forEach(function(key) {
    let obj = { "id": users[key].id, "name": users[key].name }; 
   	userArray.push(obj);
	});

   return {
     users: userArray
   }
}
  export default connect(mapStateToProps)(Login)
